import Link from 'next/link';
import Header from 'components/Header';
import React from "react";

const Index = () => (
    <div>
        <Header/>

        <h1>
            Next.js Main Page.
        </h1>

        <Link href='/about'>
          <a>Link API - About</a>
        </Link>

        <br/>

        <a href='/about'>A tag - About</a>
    </div>
);

export default Index;
